アリキンチョール 300ml<br>ブランド：キンチョール<br>販売・製造元：大日本除虫菊<br><br>シロアリ、キクイムシ、クロアリの駆除に最適なエアゾール式のアリ用殺虫剤スプレーです。<br>巣や木材のスキマ、穴には専用ノズルでシューッとひと吹き。<br>ピレスロイド(d-t-80フタルスリン、フェノトリン)が、優れた殺虫効果を発揮します。<br>クモ、ハチ、ムカデにも効きます。<br> <br>有効成分ピレスロイド(d-T-80フタルスリン、フェノトリン) 対象害虫アリ類、ハチ類、ゲジゲジ、ムカデ、シロアリ、キクイムシ、カメムシ、クモ類等 <br>日用品／虫よけ・殺虫剤・忌避／殺虫剤／殺虫剤スプレー<br>JANコード： 4987115581029<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
